sourcesContent:
import React from "react";
import Grid from "@mui/joy/Grid";
import Typography from "@mui/material/Typography";
import PersonIcon from "@mui/icons-material/Person";
import Divider from "@mui/material/Divider";
import ButtonBase from "@mui/material/ButtonBase";
import AddCircleIcon from "@mui/icons-material/AddCircle";

export default function Spese() {
  return (
    <Grid
      container
      direction="column"
      justifyContent="center"
      alignItems="center"
      style={{
        height: "100%",
        width: "100%",
        backgroundColor: "rgb(20, 42, 58)",
      }}
    >
      <Grid
        container
        direction="column"
        justifyContent="center"
        alignItems="center"
        style={{
          height: "90%",
          width: "80%",
          //backgroundColor: "rgb(203, 231, 253)",
        }}
      >
        <Grid
          container
          direction="row"
          justifyContent="flex-start"
          alignItems="center"
          style={{
            height: "10%",
            width: "100%",
            //backgroundColor: "rgb(94, 175, 70)",
          }}
        >
          <Typography
            variant="h4"
            style={{ color: "#fcfcfc" }}
            sx={{ fontWeight: "bold" }}
          >
            Spese page
          </Typography>
        </Grid>
        <Grid
          container
          direction="column"
          style={{
            borderRadius: "5%",
            height: "90%",
            width: "100%",
            backgroundColor: "rgb(203, 231, 253)",
          }}
        >
          <Grid
            container
            direction="column"
            justifyContent="center"
            style={{
              height: "79%",
              width: "100%",
              //backgroundColor: "rgb(93, 131, 53)",
            }}
          >
            <Grid
              container
              direction="row"
              justifyContent="flex-end"
              alignItems="center"
              style={{
                height: "10%",
                width: "100%",
                //backgroundColor: "rgb(193, 231,153)",
              }}
            >
              <ButtonBase
                style={{
                  height: "100%",
                  width: "15%",
                  //backgroundColor: "rgb(213, 131,153)",
                  marginRight: "1%",
                  marginTop: "1%",
                }}
              >
                <Grid
                  container
                  direction="row"
                  justifyContent="center"
                  alignItems="center"
                  style={{
                    height: "100%",
                    width: "100%",
                    //backgroundColor: "rgb(93, 131,153)",
                  }}
                >
                  <Grid
                    container
                    direction="column"
                    justifyContent="center"
                    alignItems="center"
                    style={{
                      height: "100%",
                      width: "80%",
                      //backgroundColor: "rgb(93, 31,153)",
                    }}
                  >
                    <Typography>Aggiungi</Typography>
                    <Typography>spesa</Typography>
                  </Grid>
                  <Grid
                    container
                    direction="column"
                    justifyContent="center"
                    alignItems="center"
                    style={{
                      height: "100%",
                      width: "20%",
                      //backgroundColor: "rgb(193, 31,153)",
                    }}
                  >
                    <AddCircleIcon />
                  </Grid>
                </Grid>
              </ButtonBase>
            </Grid>
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="flex-start"
              style={{
                height: "87%",
                width: "100%",
                backgroundColor: "rgb(153, 31, 53)",
                marginTop: "1%",
                overflow: "auto",
              }}
            >
              <Grid
                container
                direction="row"
                justifyContent="center"
                alignItems="center"
                style={{
                  height: "30%",
                  width: "90%",
                  backgroundColor: "rgb(53, 131, 153)",
                  marginTop: "1%",
                }}
              >
                <Grid
                  container
                  direction="row"
                  justifyContent="center"
                  alignItems="center"
                  style={{
                    height: "100%",
                    width: "44%",
                    backgroundColor: "rgb(83, 131, 43)",
                  }}
                >
                  <Grid
                    container
                    justifyContent="center"
                    alignItems="center"
                    style={{
                      height: "100%",
                      width: "30%",
                      backgroundColor: "rgb(183, 131, 43)",
                    }}
                  >
                    <Grid
                      style={{
                        height: "80%",
                        width: "90%",
                        backgroundColor: "rgb(83, 131, 43)",
                        borderRadius: "50%",
                      }}
                    ></Grid>
                  </Grid>
                  <Grid
                    container
                    direction="column"
                    justifyContent="center"
                    alignItems="center"
                    style={{
                      height: "100%",
                      width: "70%",
                      backgroundColor: "rgb(83, 31, 43)",
                    }}
                  >
                    <Typography sx={{ fontWeight: "bold" }}>
                      Titolo spesa
                    </Typography>
                    <Typography> 50 euro</Typography>
                  </Grid>
                </Grid>
                <Grid
                  direction="row"
                  justifyContent="center"
                  alignItems="center"
                  style={{
                    height: "100%",
                    width: "1%",
                    backgroundColor: "rgb(183, 131, 43)",
                  }}
                >
                  <Divider orientation="vertical" />
                </Grid>
                <Grid
                  container
                  direction="column"
                  justifyContent="center"
                  alignItems="center"
                  style={{
                    height: "100%",
                    width: "50%",
                    backgroundColor: "rgb(33, 231, 53)",
                  }}
                >
                  <Grid
                    container
